import React from 'react'
import Table from "./Table";

function Home() {
    const mystyle = {
        'margin-top': '30px',
        'display': 'flex',
        'justify-content': 'center',
        'align-item': 'center'
    };

    const data = [
        { id: 1, name: "John Doe", age: 25, email: "john@example.com", city: "New York" },
        { id: 2, name: "Jane Smith", age: 30, email: "jane@example.com", city: "London" },
        { id: 3, name: "Bob Johnson", age: 40, email: "bob@example.com", city: "Paris" },
        { id: 4, name: "Mary Williams", age: 35, email: "mary@example.com", city: "Sydney" },
        { id: 5, name: "Tom Lee", age: 28, email: "tom@example.com", city: "Hong Kong" }
    ];

    return (
        <div id="reports" style={mystyle} className="container">
            <h2>Report</h2>
            <Table data={data}></Table>
        </div>
    );
}

export default Home;
